import React from 'react';
import { Row, Input, Col, Button} from 'react-materialize'

const CreateUser = ({}) => (
  <Row>
    <Col s={12}>
      <Input s={12} label="text" id="username" />
    </Col>
    <Col s={12}>
      <Input s={12} type="url" label="User image" id="user_image"/>
    </Col>
    <Col s={12}>
      <Button waves='purple'>Create User</Button>
    </Col>
  </Row>
);

export default CreateUser;
